import React, { useState } from "react";
import HeaderComp from "./HeaderComp";
import CreateNoteComp from "./CreateNoteComp";
import FooterComp from "./FooterComp";


const GoogleKeep = () =>{

    const [list, setList] = useState([]);

    const addNote = (note)=>{
        // alert("adding element");
        setList((previousItems)=>{
            return [...previousItems, note];
        });

        console.log(note);
    }

    return(
        <div className="container-{breakpoint}">
            <HeaderComp />
            <br />
            <CreateNoteComp addNoteFun={addNote}/>
            <br />
            <FooterComp />
        </div>
    );  
}

export default GoogleKeep;
